import React, {Component} from 'react'

class Home extends Component {
	render() {
		return (
			<div className="sctn_home">
				<h1 className="sctn_heading fallable">Willkommen!</h1>
				<div className="sctn_body">
					<p className="sctn_subheading">Herzlich willkommen auf meiner Homepage! Besuchen Sie mich auch in meinem Atelier am See im Amtshaus Bad Bederkesa, Amtsstr. 8, 27624 Geestland</p>
				</div>
			</div>
		)
	}
}

export default Home
